import React from 'react';

function Navbar() {
  return (
    <nav style={styles.nav}>
      <h2 style={styles.logo}>HyperDistrict</h2>
      <div>
        <a href="#" style={styles.link}>Inicio</a>
        <a href="#" style={styles.link}>Productos</a>
        <a href="#" style={styles.link}>Contacto</a>
      </div>
    </nav>
  );
}

const styles = {
  nav: {
    background: '#000',
    color: '#fff',
    padding: '1rem 2rem',
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
  },
  logo: {
    margin: 0
  },
  link: {
    margin: '0 1rem',
    color: '#fff',
    fontWeight: 'bold'
  }
};

export default Navbar;
